var s = Snap(svgnode);
const rows = ctrl.data[0].rows[0];
const locationid = rows.locationid
const signalstrength = rows.signalstrength


buildSignalStrength();

      
function buildSignalStrength() {
    var bigCircle = s.circle(181, 80, 15);
    bigCircle.attr({
        fill: "#FFFFFF",
        stroke: "#0000FF",
        strokeWidth: 2
    });
    const text = s.text(170, 85, signalstrength)
    text.attr({
          'font-size':10,
          'fill': "#FF0000"
      });
}
